if (!window.jQuery) {
    throw ("dblp.js: jQuery library has not been loaded.")
}
if (!window.dblp) {
    var dblp = {}
} else {
    console.warn("global dblp object already exists", window.dblp)
}
dblp.BASE_URL = "http://xuyuanchao.ie.cnu.edu.cn/graduate";

dblp.COOKIE_PATH = "/";
dblp.COOKIE_EXPIRES_IN_DAYS = (30);
dblp.COOKIE_EXPIRES_IN_SECONDS = (60 * 60 * 24 * dblp.COOKIE_EXPIRES_IN_DAYS);
if (!window.console) {
    var console = {}
}
if (!console.log) {
    console.log = function() {}
}
if (!console.debug) {
    console.debug = console.log
}
if (!console.info) {
    console.info = console.debug
}
if (!console.warn) {
    console.warn = console.info
}
if (!console.error) {
    console.error = console.warn
}
dblp.LOG_LEVELS = {
    OFF: 0,
    ERROR: 10,
    WARN: 20,
    INFO: 30,
    DEBUG: 40
};
dblp.LOG_LEVEL = dblp.LOG_LEVELS.WARN;
if (dblp.LOG_LEVEL < dblp.LOG_LEVELS.DEBUG) {
    console.debug = function() {}
}
if (dblp.LOG_LEVEL < dblp.LOG_LEVELS.INFO) {
    console.info = function() {}
}
if (dblp.LOG_LEVEL < dblp.LOG_LEVELS.WARN) {
    console.warn = function() {}
}
if (dblp.LOG_LEVEL < dblp.LOG_LEVELS.ERROR) {
    console.error = function() {}
}

console.debug("this base URL: " + dblp.BASE_URL);